import React from 'react';
import { Menu } from 'antd';

export default class Home extends React.Component {
  render() {
    return (
      <>
        <Menu>
          <Menu.Item>菜单项</Menu.Item>
          <SubMenu title="子菜单">
            <Menu.Item>子菜单项</Menu.Item>
          </SubMenu>
        </Menu>
      </>
    );
  }
}
